import React, { useState } from 'react';
import MainLayout from '../layout/MainLayout'
import './UserPage.css'
import { useNavigate } from 'react-router-dom';


function UserPage(){
    const [name,Username]=useState("Dog");
    const navigate = useNavigate();
    Username(window.data.FirstName+" "+window.data.LastName);
    const logout=()=>{
        window.loginStatus=false;
        navigate('/sign-in');     
    }


    return(
        <MainLayout>
  <div className="userpage-container">
     <h1>Personal Page</h1>

     <div className='userpage-navbar'>
     <ul>
      <li><a href="#home">Account Information</a></li>
      <li><a href="#news">Wallet</a></li>
      <li><a href="#contact">Purchase History</a></li>
      <li><a href="#about" onClick={logout}>Logout</a></li>
     </ul>
     </div>

            <form className="userpage-form">
            <label>Name:</label>
            <input type="text" value={name} readonly />
            <br />
            <label>Email:</label>
            <input type="email" value="johndoe@example.com" readonly />
            <br />
            <label>Phone:</label>
            <input type="tel" value="555-1234" readonly />
            </form>

         </div>


            </MainLayout>


    )
}
export default UserPage;
